import React from 'react';
import {Nav, NavBar, Navbar, NavItem } from 'react-bootstrap';
import styled from 'styled-components';
import NavLink from 'react-bootstrap/NavLink';


const Styles = styled.div`
.NavBar {

}
`;


export const NavigationBar = () =>
(
 <NavBar expand='lg'>
     <Navbar.Brand href="/">Profile</Navbar.Brand>
     <NavBar.Toggle aria-controls="basic-nav-bar"></NavBar.Toggle>
     <NavBar.Collapse id="basic-navbar-nav">
        <Nav.Item><Nav.Link href="/" >Home</Nav.Link></Nav.Item>
        <Nav.Item><Nav.Link href="/Contact" >Contact</Nav.Link></Nav.Item>
        <Nav.Item><Nav.Link href="/Projects" >Projects</Nav.Link></Nav.Item>
        <Nav.Item><Nav.Link href="/Skills" >Skills</Nav.Link></Nav.Item>
     </NavBar.Collapse>

 </NavBar>   
)
